import React, { useState } from 'react';

function ClienteForm() {
    const [campo1, setCampo1] = useState('');
    const [campo2, setCampo2] = useState('');
    // Repite esto para los otros 19 campos

    const handleCampo1Change = (e) => {
        setCampo1(e.target.value);
    };
    const handleCampo2Change = (e) => {
        setCampo2(e.target.value);
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Envía los datos del formulario o realiza cualquier otra acción necesaria
    };

    return (

        <form id="registroCliente" action="procesar_registro.php" method="POST">
            <label for="nombre">Nombre:</label>
            <input type="text" id="nombre" name="nombre" required /><br /><br />

            <label for="apellido">Apellido:</label>
            <input type="text" id="apellido" name="apellido" required /><br /><br />

            <label for="email">Correo Electrónico:</label>
            <input type="email" id="email" name="email" required /><br /><br />

            <label for="telefono">Teléfono:</label>
            <input type="tel" id="telefono" name="telefono" /><br /><br />

            <label for="direccion">Dirección:</label>
            <textarea id="direccion" name="direccion"></textarea><br /><br />

            <label for="ciudad">Ciudad:</label>
            <input type="text" id="ciudad" name="ciudad" /><br /><br />

            <label for="pais">País:</label>
            <input type="text" id="pais" name="pais" /><br /><br />

            <input type="submit" value="Registrar" />
        </form>
    );
}

export default ClienteForm;
